import React, { useEffect, useState } from 'react';
import './Head.css';  // Import the custom CSS file

// Generate a random number between a given range
const random = (min, max) => Math.random() * (max - min) + min;

const Head = () => {
  const [snowflakes, setSnowflakes] = useState([]);

  // Create 150+ snowflakes dynamically
  useEffect(() => {
    const flakeCount = 150;
    const flakes = Array.from({ length: flakeCount }).map((_, index) => ({
      id: index,
      size: random(0.5, 2.5),    // Snowflake size
      left: random(0, 10),      // Horizontal position
      duration: random(10, 30),  // Fall duration
      delay: random(0, 15),      // Animation delay
    }));
    setSnowflakes(flakes);
  }, []);

  return (
    <section className="header">
      <div className="header-content">
        <h1>HASINI MIRYALA</h1>
        <p>Full Stack Developer</p>
      </div>
      <div className="snowflakes">
        {snowflakes.map((flake) => (
          <div
            key={flake.id}
            className="snowflake"
            style={{
              left: `${flake.left}%`,
              fontSize: `${flake.size}em`,
              animationDuration: `${flake.duration}s`,
              animationDelay: `${flake.delay}s`,
            }}
          >
            ❄  ❄  ❄  ❄
          </div>
        ))}
      </div>
    </section>
  );
};

export default Head;
